import { RemoveTopicService } from './RemoveTopicService'
import { RemoveTopicUseCase } from './RemoveTopicUseCase'

function createRemoveTopicUseCase(service: RemoveTopicService): RemoveTopicUseCase {
  return function (token, topicId) {
    return service.removeTopic(token, topicId)
  }
}

export { createRemoveTopicUseCase }
